function setOtSessionStorage(cookieType, sessionStorageName, data) {
  // var guid = "${headHelper.guidVal @ context='html'}";
  //if OT is not enabled
  if (!guid) {
    window.sessionStorage.setItem(sessionStorageName, JSON.stringify(data));
  } else {
    // if ot enabled
    var targetCookieId = [cookieType.toString()];
    var OptanonActiveGroupIds = OptanonActiveGroups.split(",");
    var targetCookieCheck = targetCookieId.every(function (val) {
      return OptanonActiveGroupIds.indexOf(val) >= 0;
    });
    //checking for cookie type
    if (targetCookieCheck == false) {
      window.sessionStorage.removeItem(sessionStorageName);
    } else {
      window.sessionStorage.setItem(sessionStorageName, JSON.stringify(data));
    }
  }
}

// Wait for element to exist.
function checkElementLoaded(el, tryCount, cb) {
  if (!tryCount) {
    return;
  }
  if ($(el).length) {
    // Element is now loaded.
    cb($(el));
  } else {
    // Repeat every 500ms.
    setTimeout(function () {
      checkElementLoaded(el, tryCount - 1, cb);
    }, 500);
  }
}


