//subnav suggestions
$(window).load(function(){
    var targetInputEl = $(".subnav-search #internalSearchForm #internalSearchInput");
    var targetEl = $(".subnav-search #internalSearchForm ul");
    
    //subnav search functionality
    $(".subnav-search .subnav-icon-search").click(function(){
        var searchTerm = $(".subnav-search-input").val();
        if(searchTerm.length > 0)
        window.location.href= searchLocation + "?qr=" + encodeURIComponent(searchTerm);
    });
    $(".subnav-search-input").on('keypress',function(e) {
        if(e.which == 13) {
            var searchTerm = $(".subnav-search-input").val();
            if(searchTerm.length > 0)
            window.location.href= searchLocation + "?qr=" + encodeURIComponent(searchTerm);
        }
    });

    function makeAPICall(qr, search_engine, search_key) {
        var settings = {
            "url": search_engine+"/template",
            "method": "POST",
            "headers": {
                "Authorization": "Apikey " + search_key,
                "Content-Type": "application/json"
            },
            "data": JSON.stringify({
                "id": "dcom-auto-suggester-search-template",
                "params": {
                  "prefix": qr,
                  "country-code": window.sc_country,
                  "country-lang": window.sc_language
                }
            }),
        };

        $.ajax(settings).done(function(response) {
                let suggestedValue= []
                let title_suggest_value= []
                let emp_title_suggest_value= []
                if (response && response['suggest'] && response['suggest']['title_suggest'][0]['options'].length){
                    title_suggest_value = response['suggest']['title_suggest'][0]['options'].map(item=>item.text)
                }
                if (response && response['suggest'] && response['suggest']['emp_title_suggest'][0]['options'].length){
                    emp_title_suggest_value = response['suggest']['emp_title_suggest'][0]['options'].map(item=>item.text)
                }
                suggestedValue = [...title_suggest_value, ...emp_title_suggest_value]
                populateDOM(qr, suggestedValue?.sort().splice(0, 5));
            });
    }
    
    function populateDOM(qr, data){
        var htmlString = "";
        data.forEach(function(item, index){
            var transformedSuggestionString = transformSuggestions(item, qr);
            htmlString += 
            "<li><a href='' title='"+ item +"'>" + 
            transformedSuggestionString + 
            "</a></li>";
        })
        $(targetEl).html(htmlString);
        //init click on li
        $(".subnav-search #internalSearchForm ul li a").on("click", function(e){
            e.preventDefault();
            window.location.href = searchLocation + "?qr=" + encodeURIComponent(e.target.innerText);
        })
        $(targetEl).show();
    }

    function transformSuggestions(text, search){
        if (search && text) {
            var pattern = search
                .replace(/[\-\[\]\/\{\}\(\)\*\+\?\.\\\^\$\|]/g, '\\$&')
                .split(' ')
                .filter(function (t) {
                  return t.length > 0   
                })
                .join('|');

            var regex = new RegExp(pattern, 'gi');

            return text.replace(regex, function(match){
                return "<strong>"+ match +"</strong>"
            }) 
        } else {
            return text;
        }
    }

	$(targetInputEl).on("input", function(e){
        var qr = e.target.value.trim();
          if (qr.length >= 3) {
            //hit api and get suggestions
            makeAPICall(qr, search_engine, search_key)
        }
        else{
            $(targetEl).hide();
        }
        e.stopPropagation();
	});
});
